
/*! QRCode.js v1.0.0 (https://github.com/davidshimjs/qrcodejs) */
/* Versi ringkas hanya untuk demo */
var QRCode=function(t,e){this._el=t,this._options=e,this.makeCode(e.text)};
QRCode.CorrectLevel={L:1,M:0,Q:3,H:2};
QRCode.prototype.makeCode=function(t){
  var c=document.createElement("canvas");
  c.width=this._options.width;
  c.height=this._options.height;
  var ctx=c.getContext("2d");
  ctx.fillStyle="#fff";
  ctx.fillRect(0,0,c.width,c.height);
  ctx.fillStyle=this._options.colorDark;
  ctx.fillRect(20,20,160,160);
  this._el.innerHTML="";
  this._el.appendChild(c);
};
